import math
memo = {}

def divisors(n):
    if n not in memo:
        return memo[n]
    divs = [1]
    for i in range(2, int(math.sqrt(n)) + 1):
        if n % i == 0:
            divs.extend([i, int(n / i)])
    divs.extend([n])
    memo[n] = list(set(divs))
    return memo[n]

def find_max_k(test_cases):
    results = []
    for (n, nums) in test_cases:
        mxK = 0
        for j in nums:
            diff = [x - j for x in nums]
            k = max(diff)
            cnt = diff.count(0)
            if cnt >= n / 2:
                mxK = -1
                break
            cnt_div = {}
            for i in diff:
                if i > 0:
                    divs = divisors(i)
                    for d in divs:
                        cnt_div[d] = cnt_div.get(d, 0) + 1
            cnt_div = sorted(cnt_div.items(), reverse=True)
            for (u, v) in cnt_div:
                if v + cnt >= n / 2:
                    mxK = max(mxK, u)
        results.append(mxK if mxK > 0 else -1)
    return results

